import React from "react";
import logo from "./../imagesMenu/logo.png";
import {Link} from "react-router-dom";

function Header() {
  return (
    <>
      <header class>
        <section className="logo">
          <Link to="/">
            <img src={logo} alt="Logo" />
          </Link>
        </section>
      </header>
    </>
  );
}


export {Header};
